import './Tracker.css';
import React, { Component } from 'react';
import Details from './TrackerComp/Details.js';
import Image from './TrackerComp/Image.js';

export default class Tracker extends Component {
  render() {
    return (
    <div className='tracker'>
        <Image/>
        <Details/>
    </div>
    )
  }
}
